   function YYYYDD(str) //年发生变化时日期发生变化(主要是判断闰平年)   
   {   
           var MMvalue = document.reg_testdate.MM.options[document.reg_testdate.MM.selectedIndex].value;   
           if (MMvalue == ""){ var e = document.reg_testdate.DD; optionsClear(e); return;}   
           var n = MonHead[MMvalue - 1];   
           if (MMvalue ==2 && IsPinYear(str)) n++;   
                writeDay(n)   
   }   
   function MMDD(str)   //月发生变化时日期联动   
   {   
        var YYYYvalue = document.reg_testdate.YYYY.options[document.reg_testdate.YYYY.selectedIndex].value;   
        if (YYYYvalue == ""){ var e = document.reg_testdate.DD; optionsClear(e); return;}   
        var n = MonHead[str - 1];   
        if (str ==2 && IsPinYear(YYYYvalue)) n++;   
       writeDay(n)   
   }   
   function writeDay(n)   //据条件写日期的下拉框   
   {   
           var e = document.reg_testdate.DD; optionsClear(e);   
           for (var i=1; i<(n+1); i++)   
                e.options.add(new Option(" "+ i, i));   
   }   
   function IsPinYear(year)//判断是否闰平年   
   {     return(0 == year%4 && (year%100 !=0 || year%400 == 0));}   
   function optionsClear(e)   
   {   
        e.options.length = 1;   
   }   

jQuery.fn.extend({
	checkBind:function($employeeCheckbox,$ubCheckBtn){
		// this; 是全选复选框
		$(this).click(function(){
			$employeeCheckbox.checkAll(this.checked);
		});


		$employeeCheckbox.click(()=>{
			$employeeCheckbox.fanCheck(this);
		});

		if($ubCheckBtn){
			$ubCheckBtn.click(()=>{
				$employeeCheckbox.uncheck();
				$employeeCheckbox.fanCheck(this);
			});	
		}
	},
	checkAll:function(isChecked){   
		this.attr("checked",isChecked);
	},
	uncheck:function(){
		this.each(function(){
			//this:循环过程中的每个DOM对象
			this.checked = !this.checked;
		});
	},
	fanCheck:function($leaderCheck){
		let isAllCheck = true;//假定全部选中
		this.each(function(){
			if(!this.checked){
				isAllCheck = false;
			}
		});
		$leaderCheck.attr("checked",isAllCheck);
	}
}); 
//正则验证
function check(str, type) {
	switch (type) {
		case "username":
			var r = /^[a-zA-Z_]\w{5,14}$/;
			break;
			//数字，字母，下划线，6,16
		case "userpass":
			var r = /^\w{6,16}$/;
			break;
		case "userphone":
			var r = /^1[3-9]\d{9}$/;
			break;
	}
	return r.test(str);
}

function ajaxByPromise(url,method,params,isAsync){
	//1、创建对象
	let xhr = new XMLHttpRequest();

	//产生请求参数的字符串：循环把json对象转换为形如这样的格式：key1=value1&key2=value2
	let sendstr = '';
	for(let key in params){
		sendstr += `${key}=${params[key]}&`;
		// sendstr += key+"="+params[key]+"&"
	}
	if(sendstr.length>0){
		sendstr = sendstr.substring(0,sendstr.length-1); //musicname=你
	}
	
	let urlAndParam = url;//getMusic.php
	//如果是get方式，并且有请求参数，那么就把url和请求参数用问号隔开
	if(method.toLowerCase()=="get" && sendstr!=""){
		urlAndParam+= "?"+sendstr;//getMusic.php?musicname=你
	}

	//2、设置请求参数
	xhr.open(method,urlAndParam,isAsync);

	let p = new Promise(function(resolve,reject){
		//3、设置回调函数
		xhr.onreadystatechange = function(){			
			if(xhr.readyState==4){
				if(xhr.status==200){
					if(resolve){
						resolve(xhr.responseText);
					}
				}else{
					if(reject){
						reject("服务器出错了");
					}
				}
			}
		}
	});

	if(method.toLowerCase()=="post"){
		xhr.setRequestHeader('Content-type','application/x-www-form-urlencoded');
		xhr.send(sendstr);
	}else{
		//4、发送请求
		xhr.send();	
	}
	return p;
}
